INSERT INTO `organizaciones` (`id`, `nombre`, `descripcion`, `domicilio`, `numero`, `link`, `imagen`) VALUES
(40, 'DIF NEZAHUALCÓYOTL', 'Es una organización civil que agrupa y coordina una red de refugios y centros de atención externa para mujeres, sus hijas e hijos, en situación de violencia extrema. Ofrecen alojamiento seguro, alimentación, atención psicológica, asesoría jurídica, talleres de empoderamiento y acompañamiento para la construcción de una vida libre de violencia.', 'Calle Aviación Civil s/n, Gral Vicente Villada, 57710 Cdad. Nezahualcóyotl, Méx.', '+525526197110', NULL, );
INSERT INTO `organizaciones` (`id`, `nombre`, `descripcion`, `domicilio`, `numero`, `link`, `imagen`) VALUES
(41, 'Instituto Nacional de las Mujeres (Inmujeres).', 'El organismo de la administración pública del Gobierno de la Ciudad de México responsable de lograr que se garantice la protección y ejercicio pleno de los derechos humanos de las mujeres y las niñas, para erradicar la discriminación y alcanzar la igualdad sustantiva.', NULL, '55 5322 6030', NULL, );
INSERT INTO `organizaciones` (`id`, `nombre`, `descripcion`, `domicilio`, `numero`, `link`, `imagen`) VALUES
(43, 'Comisión Nacional para Prevenir y Erradicar la Violencia Contra las Mujeres (CONAVIM)', 'Es un órgano desconcentrado de la Secretaría de Gobernación (SEGOB) del Gobierno de México. Su función principal es diseñar, coordinar y ejecutar la política nacional para prevenir, atender, sancionar y erradicar la violencia contra las mujeres. Aunque no brindan atención directa en refugios, son clave en la coordinación de los esfuerzos institucionales y la promoción de leyes y políticas públicas.', NULL, 'S/N', NULL, ),
(44, 'Fundación Origen', 'Es una fundación que se enfoca en apoyar a mujeres en situación de vulnerabilidad, incluyendo aquellas que han experimentado violencia. Ofrecen líneas de ayuda telefónica, atención psicológica, asesoría legal y talleres de desarrollo personal y empoderamiento económico, con un enfoque en la reconstrucción de la vida de las mujeres.', NULL, '800 00 674436', NULL, );
INSERT INTO `organizaciones` (`id`, `nombre`, `descripcion`, `domicilio`, `numero`, `link`, `imagen`) VALUES
(46, 'Consejo Nacional Para Prevenir la Discriminación (Conapred).', 'Contribuir a que toda persona ejerza, sin discriminación, todos los derechos y libertades consagrados en el orden jurídico mexicano. Consolidarnos como la institución rectora que coloque en el centro de la agenda nacional el respeto al derecho a la igualdad y no discriminación.', NULL, '800 543 0033', NULL, ),
(49, 'Centro Horizonte Masculino', 'Organización dedicada a brindar apoyo psicológico a hombres que enfrentan depresión, ansiedad o dificultad para expresar sus emociones, promoviendo la salud emocional y la empatía.', 'Av. Insurgentes Sur 2450, Ciudad de México', '5512345678', NULL, NULL),
